import React from 'react';



import tp1 from '../assets/images/typography/Artboard 1-100.jpg';
import tp2 from '../assets/images/typography/Artboard 2-100.jpg';
import tp3 from '../assets/images/typography/Artboard 3-100.jpg';
import tp4 from '../assets/images/typography/Artboard 4-100.jpg';
import tp5 from '../assets/images/typography/Artboard 5-100.jpg';
 import tp6 from '../assets/images/typography/Artboard 6-100.jpg';
 import tp7 from '../assets/images/typography/Artboard 7-100.jpg';
 import tp8 from '../assets/images/typography/Artboard 8-100.jpg';

import Descreption from '../components/DescreptionSection/Descreption.component';
import Typography from '../components/Card/Typography.component';

const Logos = () => {
   return (
       <div className='container flex--wrap'>

         <div className='container'>

         <Descreption  title='Logos I create..' paragraphe='Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industrys standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book'/>
         </div>

      <div className='container'>
      <div className='flex--wrap'>
               <div class="box a">

            <Typography image={tp1} title='tp 1' goto='#' />
               </div>
               <div class="box b">

               </div>
  <div class="box c">  </div>
  <div class="box d">  </div>
  <div class="box e">  </div>
  <div class="box f">  </div>
  <div class="box j">  </div>
  <div class="box h">  </div>
            <Typography image={tp2} title='tp 2' goto='#' />
            <Typography image={tp3} title='tp 3' goto='#' />
            <Typography image={tp4} title='tp 4' goto='#' />
            <Typography image={tp5} title='tp 5' goto='#' />
            <Typography image={tp6} title='tp 6' goto='#' />
            <Typography image={tp7} title='tp 7' goto='#' />
            <Typography image={tp8} title='tp 8' goto='#' />

         </div>
      </div>
      </div>

   );
};

export default Logos;
